import React from "react";
import {
  CheckCircleTwoTone,
  HeartTwoTone,
  SmileTwoTone,
} from "@ant-design/icons";
import "../../../../index.css";
import "antd/dist/antd.min.css";
import { Space } from "antd";

export default function Favourites() {
  return (
    <Space>
      <SmileTwoTone />
      <HeartTwoTone twoToneColor="#eb2f96" />
      <CheckCircleTwoTone twoToneColor="#52c41a" />
    </Space>
  );
}
